column37:
Assess system change that necessitate Global Compliance review.

Global Trade Compliance review is needed if major change has occurred since the last Global Trade Compliance review.  
- Which user types have access to the IS;
- What information may be posted and accessible in the IS;
- Where the IS will be located;

A ?Major Change? is any of the following:
- Moving the IS from a Raytheon data center to the cloud;
- New interface with another IS; or
- Any other change that would move the IS from one Type of IS as defined by PI-OGC GTC-5012 to another Type (i.e., to one with a different set of controls).

A/C:
-  Global Trade Compliance questionnaire is complete in Archer.
